import 'package:flutter/cupertino.dart';
import 'package:restaurant/models/food_detail_model.dart';

class FoodDetailRiverpod extends ChangeNotifier {
  List<FoodDetailModel> productss = [];
  List<FoodDetailModel> favorites = [];
  List<FoodDetailModel> basketProducts = [];

  void setFavorite(FoodDetailModel model) {
    if (model.isFavorite) {
      model.isFavorite = false;
      favorites.remove(model);
      notifyListeners();
    } else {
      model.isFavorite = true;
      favorites.add(model);
      notifyListeners();
    }
    notifyListeners();
  }
}

